    false,nt"url": null,nt"notes": " n        Research Questions. Through an
    analysis of business plans, borrower files, repayment data, applicant questionnaires,
    as well as information from interviews with applicants and MCC, BMI, and FOMILENIO
    personnel, Mathematica will answer the following eight primary research nquestions:
    n n1. What were FIDENORTEu2019s levels of demand, investment and costs? n2. What
    were the average characteristics of FIDENORTE loans? n3. What were the characteristics
    of FIDENORTE applicants and borrowers? n4. What administrative activities and services
    did BMI and FOMILENIO perform (or finance) related to developing, approving, disbursing,
    and monitoring credits?n5. What were facilitators and barriers to efficient and
    effective implementation of FIDENORTE lending? n6. How did borrowers use FIDENORTE
    credit and technical assistance? n7. What were borrowersu2019 levels of investment,
    employment, and income following receipt of FIDENORTE credit?n8. Were there possible
    effects of FIDENORTE at the organizational or systemic level?nnThe exposure period
    was 24 to 36 months.n      ",nt"license_title": "License Not Specified",nt"extras":
